import { types } from "./actionTypes";
import server from "../../api/server";

const token = localStorage.getItem("token");

export const getQuiz = quizId => async dispatch => {
  await server
    .get(`/quiz/${quizId}/`, {
      headers: { authorization: `Token ${token}` }
    })
    .then(res => {
      dispatch({
        type: types.GET_QUIZ,
        payload: res.data
      });
    });
};
